import React from "react";
import {Card} from "react-bootstrap";
// import axios from "axios";
import "./groupProjects.css";

const GroupProjects = (props) => {
return (
  <div> 
    <br/>
  <h4>  Group Projects </h4>
  <Card className = "" style={{ width: "20rem" }}>
  <Card.Body>
  <Card.Title>{props.GroupProjectTitle}</Card.Title>
  <Card.Subtitle className="mb-2 text-muted">{props.GroupProjectInfo}</Card.Subtitle>
  <Card.Link href= {props.GroupProjectGit} ></Card.Link>
  <Card.Link href= {props.GroupProjectLink} ></Card.Link>
  </Card.Body>
  </Card>
  </div>
)
}

export default GroupProjects;
